import './App.css';
import Login from './components/Login';
import Connecte from './components/Connecte';
import Signup from './components/Signup_';
import Test from './components/Test';
import Login_fct from './components/Login_fct';
import { BrowserRouter, Routes, Route, Link } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
            <Route path="/signupfct" element={<Signup_fct />} />
            <Route path="/" element={<Login />} />
            <Route path="/loginfct" element={<Login_fct />} />

        </Routes>
        <Link to="/">Je n'ai pas de compte</Link>
        <br/>
        <Link to="/signup">J'ai un compte</Link>

      </BrowserRouter>
    </div>
  );
}

export default App;
